import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';

import './App.scss';



import Header from './Header';
import Recrutement from './Recrutement';


class Gestion extends Component {
    render() {
        return (
            <div className="gestion-button-container">
                <Button className="gerer-demandes" variant="contained" color="default">Gérer les demandes</Button>
                <Button className="gerer-demandes" variant="contained" color="default">Demandes traitées</Button>
            </div>
            
        )
    }
}


class Choix extends Component {


    constructor(props) {
        super(props);
        this.state = {type: ["a", "b", "c"]};
    }

    render() {
        return (
            <div className="choix-demande">
                <FormControl >
                    <InputLabel id="demo-simple-select-label">Type de demande</InputLabel>
                    <Select labelId="demo-simple-select-label" id="demo-simple-select" value={age} onChange={handleChange}>
                        <MenuItem value={10}>Ten</MenuItem>
                        <MenuItem value={20}>Twenty</MenuItem>
                        <MenuItem value={30}>Thirty</MenuItem>
                    </Select>
                </FormControl>
            </div>
        )
    }
}



class PageDemandes extends Component {
  render() {
    return (    
    <div>
      <Header />
      <hr className="overall-separator" />
      <Gestion />
      <Recrutement />
      <br></br>
      <div className="end">
        <center>Copyright <span>&#169;</span> 2021 tous les droits résérvés.</center>
      </div>

    </div>
    );
  }

}
export default PageDemandes;
